package com.qtz.sm.supermarket.page;import com.mall.core.vo.Pager;/** * <p> * Title:SupermarketInfoPage * </p> * <p> * Description:超市基本信息分页类 * </p> * <p> * Copyright: Copyright (c) 2016 * </p> * <p> * Company: 深圳擎天柱信息技术有限公司 * </p> *  * @author 刘晓峰 - Laven * @version v1.0 2016-04-26 */public class SupermarketInfoPage extends Pager<com.qtz.sm.supermarket.vo.SupermarketInfo, Long>        implements java.io.Serializable {            /** 类的版本号 */    private static final long serialVersionUID = 1636495978596353L;        /** 主键ID */    private Long dmId;    /** 超市编号 */    private Long code;    /** 超市名称 */    private String name;    /** 手机号码 */    private String mobile;    /** 结算周期 */    private Integer ettlementCycle;    /** 法人(lp,legal persion)名称 */    private String lpName;    /** 法人(lp,legal persion)身份证 */    private String lpIdCard;    /** 营业执照 */    private String licence;    /** 身份证正面 */    private String idCardFront;    /** 身份证反面 */    private String idCardBehind;    /**  */    private java.util.Date createTime;    /**  */    private java.util.Date updateTime;        public Long getDmId() {        return this.dmId;    }        public void setDmId(Long dmId) {        this.dmId = dmId;    }        public Long getCode() {        return this.code;    }        public void setCode(Long code) {        this.code = code;    }        public String getName() {        return this.name;    }        public void setName(String name) {        this.name = name;    }        public String getMobile() {        return this.mobile;    }        public void setMobile(String mobile) {        this.mobile = mobile;    }        public Integer getEttlementCycle() {        return this.ettlementCycle;    }        public void setEttlementCycle(Integer ettlementCycle) {        this.ettlementCycle = ettlementCycle;    }        public String getLpName() {        return this.lpName;    }        public void setLpName(String lpName) {        this.lpName = lpName;    }        public String getLpIdCard() {        return this.lpIdCard;    }        public void setLpIdCard(String lpIdCard) {        this.lpIdCard = lpIdCard;    }        public String getLicence() {        return this.licence;    }        public void setLicence(String licence) {        this.licence = licence;    }        public String getIdCardFront() {        return this.idCardFront;    }        public void setIdCardFront(String idCardFront) {        this.idCardFront = idCardFront;    }        public String getIdCardBehind() {        return this.idCardBehind;    }        public void setIdCardBehind(String idCardBehind) {        this.idCardBehind = idCardBehind;    }        public java.util.Date getCreateTime() {        return this.createTime;    }        public void setCreateTime(java.util.Date createTime) {        this.createTime = createTime;    }        public java.util.Date getUpdateTime() {        return this.updateTime;    }        public void setUpdateTime(java.util.Date updateTime) {        this.updateTime = updateTime;    }        public String getMysqlOrderCondition() {            return super.getMysqlOrderCondition();    }        public String toString() {        return "[" + "dmId:" + getDmId() + "," + "code:" + getCode() + "," + "name:" + getName() + "," + "mobile:"                + getMobile() + "," + "ettlementCycle:" + getEttlementCycle() + "," + "lpName:" + getLpName() + ","                + "lpIdCard:" + getLpIdCard() + "," + "licence:" + getLicence() + "," + "idCardFront:"                + getIdCardFront() + "," + "idCardBehind:" + getIdCardBehind() + "," + "createTime:" + getCreateTime()                + "," + "updateTime:" + getUpdateTime() + "]";    }}